# This code snippet will import all necessary libraries
import re
import nltk
import string
import numpy as np
import pandas as pd
from nltk.corpus import stopwords
from nltk.tokenize import word_tokenize
from nltk.stem.snowball import SnowballStemmer

# View dataset content
Data1 = pd.read_csv("Data/twitter_anglophone_crises_data.csv")
Data1

# Renaming columns and removing unnecessary columns
Data1.rename(columns = {'Unnamed: 0':'S/N'}, inplace = True)
del Data1['S/N']
Data1 = Data1[['User', 'Tweet', 'Date']]
Data1.head(5)

# View dataset content
Data2 = pd.read_csv("Data/FB_angl.csv")
Data2

# Renaming columns and removing unnecessary columns
Data2.rename(columns = {'Page Name':'Author','Message':'Post','Post Created':'Date'}, inplace = True)
Data2 = Data2[['Author', 'Post', 'Date']]
Data2.head(5)

"""**PHASE 2: Data Merge**

---
"""

# Merge by concatenation of all imported data sets
# Data = pd.concat([Data1, Data2, Data3], ignore_index = True, sort = False)
# Data

"""**PHASE 3: Html Stripping**

---
"""

# Striping HTML tags and HTTP links
Data1['User'] = Data1['User'].str.replace(r'<[^<>]*>', '', regex=True)
Data1['Tweet'] = Data1['Tweet'].str.replace(r'<[^<>]*>', '', regex=True)
Data1['User'] = Data1['User'].apply(lambda x: re.split('https:\/\/.*', str(x))[0])
Data1['Tweet'] = Data1['Tweet'].apply(lambda x: re.split('https:\/\/.*', str(x))[0])
Data1

# Striping HTML tags and HTTP links
Data2['Author'] = Data2['Author'].str.replace(r'<[^<>]*>', '', regex=True)
Data2['Post'] = Data2['Post'].str.replace(r'<[^<>]*>', '', regex=True)
Data2['Author'] = Data2['Author'].apply(lambda x: re.split('https:\/\/.*', str(x))[0])
Data2['Post'] = Data2['Post'].apply(lambda x: re.split('https:\/\/.*', str(x))[0])
Data2

"""**PHASE 4: Fixing Redundancy**

---
"""

# Verifying empty cell existence
print(Data1.isnull().sum())

# Verifying empty cell existence
print(Data2.isnull().sum())

# Verifying duplicate cell existence
Data1.duplicated().sum()

# Verifying duplicate cell existence
Data2.duplicated().sum()

# Managing empty cells and duplicate instances
Data1 = Data1.dropna()
Data1.drop_duplicates(keep = 'first', inplace = True)

# Managing empty cells and duplicate instances
Data2 = Data2.dropna()
Data2.drop_duplicates(keep = 'first', inplace = True)

# Verifying empty cell existence
print(Data1.isnull().sum())

# Verifying empty cell existence
print(Data2.isnull().sum())

# Verifying duplicate cell existence
Data1.duplicated().sum()

# Verifying duplicate cell existence
Data2.duplicated().sum()

"""**PHASE 5: Tokenizing**

---
"""

# Tokenizing Tweet column
Tweet = Data1['Tweet']
tokenized_docs = [word_tokenize(doc) for doc in Tweet]
Data1['Tweet'] = tokenized_docs

# Placing tokenized dataframe in an html file
Data1.to_html('FullData/Tokenized/TokenizedData1.html')
Data1.head(5)

# Tokenizing Post column
Post = Data2['Post']
tokenized_docs2 = [word_tokenize(doc) for doc in Post]
Data2['Post'] = tokenized_docs2

# Placing tokenized dataframe in an html file
Data2.to_html('FullData/Tokenized/TokenizedData2.html')
Data2.head(5)

"""**PHASE 6: Removing Stopwords**

---
"""

# Removing stopwords
stop = stopwords.words('english')
Data1['Tweet'] = Data1['Tweet'].apply(lambda x: [item for item in x if item not in stop])
Data1.head(5)

# Removing stopwords
stop = stopwords.words('english')
Data2['Post'] = Data2['Post'].apply(lambda x: [item for item in x if item not in stop])
stop2 = stopwords.words('french')
Data2['Post'] = Data2['Post'].apply(lambda x: [item for item in x if item not in stop2])
Data2.head(5)

"""**PHASE 7: Removing Punctuation**

---
"""

# Stripping punctuation from columns
Data1['Tweet'] = Data1['Tweet'].apply(lambda x: ([i for i in x if i not in string.punctuation]))

# Placing depunctuated dataframe in an html file
Data1.to_html('FullData/Depunctuated/DepunctuatedData1.html')
Data1.head(5)

# Stripping punctuation from columns
Data2['Post'] = Data2['Post'].apply(lambda x: ([i for i in x if i not in string.punctuation]))

# Placing depunctuated dataframe in an html file
Data2.to_html('FullData/Depunctuated/DepunctuatedData2.html')
Data2.head(5)

"""**PHASE 8: Stemming and Lemmatizing**

---
"""

# Finding root words
snowball = SnowballStemmer('english')
Data1['Tweet'] = Data1['Tweet'].apply(lambda x: [snowball.stem(y) for y in x])

# Placing root word dataframe in an html file
Data1.to_html('FullData/Stemmed/StemmedData1.html')
Data1.head(5)

# Finding root words
snowball = SnowballStemmer('english')
Data2['Post'] = Data2['Post'].apply(lambda x: [snowball.stem(y) for y in x])
snowball2 = SnowballStemmer('french')
Data2['Post'] = Data2['Post'].apply(lambda x: [snowball2.stem(y) for y in x])

# Placing root word dataframe in an html file
Data2.to_html('FullData/Stemmed/StemmedData2.html')
Data2.head(5)

"""**PHASE 10: Removing Irrelevant Content**

---
"""

Data1['Tweet'] = Data1['Tweet'].apply(lambda x: ' '.join([item for item in x if len(item)>2]))
Data1

# Verifying empty cell existence
print(Data1.isnull().sum())

Data2['Post'] = Data2['Post'].apply(lambda x: ' '.join([item for item in x if len(item)>2]))
Data2

# Verifying empty cell existence
print(Data2.isnull().sum())

"""**PHASE 10: Cleaned Dataset Output**

---
"""

# Exporting clean data to a csv file
Data1.to_csv("CleanData/CleanTweeterData.csv")

Data2.to_csv("CleanData/CleanFacebookData.csv")